import React from 'react';
import { Link } from 'react-scroll';

function Navigation() {
  return (
    <nav className="flex justify-center space-x-4">
      <Link to="hero" smooth={true} duration={800} className="text-white">
        Home
      </Link>
      <Link to="work" smooth={true} duration={800} className="text-white">
        My Work
      </Link>
      <Link to="contact" smooth={true} duration={800} className="text-white">
        Contact
      </Link>
    </nav>
  );
}

export default Navigation;
